      names.push(await contract.methods.getPetNameByDid(`${dids[i]}`).call());
    }
    if(dids === undefined){
      res.status(404).send(`${address}로 등록된 did가 없습니다`);
    }
    else {
      res.status(200).send({address : address, dids: dids, names:names, length:length});
    }
  }
});

